#include<bits/stdc++.h>
using namespace std;
int main()
{
	int x,y,n;
	scanf("%d %d %d",&n,&x,&y);
	for(int i=1;i<=n;i++)
		printf("(%d,%d) ",x,i);
	printf("\n");
	for(int i=1;i<=n;i++)
		printf("(%d,%d) ",i,y);
	printf("\n");
	for(int i=1;i<=n;i++)
	{
		for(int j=1;j<=n;j++)
		{
			if(i-j==x-y)
				printf("(%d,%d) ",i,j);
		}
		
	}
	printf("\n");
	for(int i=1;i<=n;i++)
	{
		for(int j=1;j<=n;j++)
		{
			if(i+j==x+y)
				printf("(%d,%d) ",j,i);
		}
		
	}
	return 0;
}
